{"language":"Solidity","sources":{"bbbbb.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract SmartContractDetective {
    struct CaseResult {
        uint256 seed;
        uint8 result; // 1 = success, 2 = partial, 3 = fail
        uint256 timestamp;
        bool completed;
    }

    mapping(address => mapping(uint8 => CaseResult)) public playerCases;

    event CaseStarted(address indexed player, uint8 caseId, uint256 seed);
    event CaseCompleted(address indexed player, uint8 caseId, uint8 result, string message);

    function startCase(uint8 caseId) external {
        require(playerCases[msg.sender][caseId].seed == 0, "Already started this case");
        uint256 seed = uint256(keccak256(abi.encodePacked(msg.sender, caseId, block.timestamp, block.prevrandao)));
        playerCases[msg.sender][caseId] = CaseResult(seed, 0, block.timestamp, false);
        emit CaseStarted(msg.sender, caseId, seed);
    }

    function completeCase(uint8 caseId, uint8 result) external {
        CaseResult storage r = playerCases[msg.sender][caseId];
        require(r.seed != 0, "Start case first");
        require(!r.completed, "Already completed");
        r.result = result;
        r.timestamp = block.timestamp;
        r.completed = true;
        string memory message;
        if (result == 1) message = "You solved the case and exposed the attacker.";
        else if (result == 2) message = "You found clues but failed to recover the funds.";
        else if (result == 3) message = "You accused the wrong wallet. Case unresolved.";
        else message = "Case closed with unknown outcome.";
        emit CaseCompleted(msg.sender, caseId, result, message);
    }
}
